# Створити колбек функцію для завершення навчання мережі при досягненні
# точності більше 0.999
class myCallback(tf.keras.callbacks.Callback):
   def on_epoch_end(self, epoch, logs={}):
        # Зупинити тренування коли точність перевищить 0.999
        if logs.get('accuracy') > 0.999:
            print("\nТочність досягла 99.9%, зупиняємо тренування!")
            self.model.stop_training = True

# імпортуємо ImageDataGenerator для завантаження зображень різних класів
from tensorflow.keras.preprocessing.image import ImageDataGenerator

def image_generator():
    ### ПОЧАТОК КОДУ
    # Створити ImageDataGenerator з нормалізацією пікселів (rescale)
    train_datagen = ImageDataGenerator(rescale=1./255)
    
    # Створіть метод для завантаження зображень з каталогу та передайте
    # відповідні аргументи:
    train_generator = train_datagen.flow_from_directory(
        directory=base_dir,  # шлях до каталогу, що містить папки happy і sad
        target_size=(150, 150),  # розмір зображення без кольорового виміру (150x150)
        batch_size=10,  # кількість зображень в одній партії
        class_mode='binary'  # бінарна класифікація (0 для одного класу, 1 для іншого)
    )

    ### END CODE HERE
    return train_generator

# Збережіть генератори у змінних
gen = image_generator()

