from tensorflow.keras import optimizers, losses
from tensorflow.keras.optimizers import RMSprop
# GRADED FUNCTION: train_happy_sad_model
def train_happy_sad_model(train_generator, val_generator=None):
    # Створіть екземляр екземпляр зворотного виклику
    callbacks = myCallback()
    ### ПОЧАТОК КОДУ
    # Визначіть модель
    model = tf.keras.models.Sequential([
        tf.keras.layers.Conv2D(16, (3,3), activation='relu', input_shape=(150, 150, 3)),
        tf.keras.layers.MaxPooling2D(2, 2),
        tf.keras.layers.Conv2D(32, (3,3), activation='relu'),
        tf.keras.layers.MaxPooling2D(2,2),
        tf.keras.layers.Conv2D(64, (3,3), activation='relu'),
        tf.keras.layers.MaxPooling2D(2,2),
        tf.keras.layers.Flatten(),
        tf.keras.layers.Dense(512, activation='relu'),
        tf.keras.layers.Dense(1, activation='sigmoid')  # Бінарна класифікація
    ])

    # Скомпілюйте модель
    # Оберіть функцію втрат, що відповідає функції страт останнього шару мережі
    model.compile(loss='binary_crossentropy',
                  optimizer=RMSprop(learning_rate=0.001),
                  metrics=['accuracy'])

    # Навчіть модель
    # Модель повинна досягти бажаної точності менше, ніж за 15 епох
    # з використанням колбек функції
    history = model.fit(
        train_generator,
        steps_per_epoch=8,  # Кількість кроків за епоху
        epochs=15,
        verbose=1,
        callbacks=[callbacks]
    )

    ### КІНЕЦЬ КОДА
    return model, history

model, hist = train_happy_sad_model(gen)

print(f"Ваша модель досягла бажаної точності за {len(hist.epoch)} епох")

