import os
from tensorflow.keras.preprocessing import image
import numpy as np

# Функція для тестування одного зображення
def test_single_image(model, img_path):
    # Завантажуємо зображення
    img = image.load_img(img_path, target_size=(150, 150))
    
    # Підготуйте дані для передачі в модель:
    # -змініть розмір у відповідності до розміру зображень для тренувань
    # -нормалізуйте зображення
    img_array = image.img_to_array(img)
    img_array = np.expand_dims(img_array, axis=0)  # Додаємо batch dimension
    img_array = img_array / 255.0  # Нормалізуємо до діапазону [0, 1]
    
    # Робимо передбачення
    prediction = model.predict(img_array)
    
    if prediction[0] > 0.5:
        return "Happy", prediction[0][0]
    else:
        return "Sad", prediction[0][0]

